import React, { Component } from "react";
import { createStore } from 'redux'

class Counters extends Component {
  render() {
    return (
      <div>
        <div>Hello World</div>
      </div>
    );
  }



  componentDidMount() {

    function counter(state = 0, action) {
      switch (action.type) {
        case 'INCREMENT':
          return state + 1
        case 'DECREMENT':
          return state - 1
        default:
          return state
      }
    }

  }
}

export default Counters;
